package com.emcan.zella.Beans;import java.util.ArrayList;public class SettingsResponse {    private int success;    private ArrayList<Settings> product;    public int getSuccess() {        return success;    }    public void setSuccess(int success) {        this.success = success;    }    public ArrayList<Settings> getProduct() {        return product;    }    public void setProduct(ArrayList<Settings> product) {        this.product = product;    }    public class Settings{        private String android_version,copyright_name,copyright_link;        public String getAndroid_version() {            return android_version;        }        public void setAndroid_version(String android_version) {            this.android_version = android_version;        }        public String getCopyright_name() {            return copyright_name;        }        public void setCopyright_name(String copyright_name) {            this.copyright_name = copyright_name;        }        public String getCopyright_link() {            return copyright_link;        }        public void setCopyright_link(String copyright_link) {            this.copyright_link = copyright_link;        }    }}